/*
 * Fetch url for a given team key
 */
function getLogoURL(key) {
    //console.log(key);
	if( Teams.has(key) ) {
    	return Teams.get(key).logoUrl;
    }
    else {
    	return { "venue": "" , "getLogoUrl": "" };
    }
}

function googleFormat(f) {
	let result="";

	for( let i=0; i<f.length; ++i) {
		let ch = f.charAt(i)
		result += ch == ' ' ? '+': f.charAt(i)
	}

	return result;
}


function getStadion(key) {
    //console.log(key);
	if( Teams.has(key) ) {
    	return googleFormat( Teams.get(key).venue.trim() )
    }
    else {
    	return { "venue": "" , "getLogoUrl": "" };
    }
}

